import { createApp } from 'vue'
import App from './App.vue'
import {createRouter, createWebHistory} from 'vue-router'
import PageSchedule from './screens/schedule/PageSchedule.vue'
import PageEstablish from './screens/establish/PageEstablish.vue'
import ScreenAuthority from './screens/establish/authori/ScreenAuthority.vue'
import ScreenUser from './screens/establish/user/ScreenUser.vue'
import ScreenUserGroup from './screens/establish/userGroup/ScreenUserGroup.vue'
import DxSelectBox from "devextreme-vue/select-box"
import DxTagBox from "devextreme-vue/tag-box"
import DxCheckBox from "devextreme-vue/check-box"
import DxDropDownBox from 'devextreme-vue/drop-down-box';
import DxTreeView from 'devextreme-vue/tree-view';
import { DxDataGrid, DxColumn, DxScrolling, DxPaging} from "devextreme-vue/data-grid";
import BaseInput from './components/base/BaseInput.vue'
import BaseButton from './components/base/BaseButton.vue'
import BasePaging from './components/base/BasePaging.vue'

// import 'devextreme/dist/css/dx.light.css';

const routers = [
    {path: "/schedule", component: PageSchedule},
    {path: "/mission", component: PageSchedule},
    {path: "/transport", component: PageSchedule},
    {path: "/advance", component: PageSchedule},
    {path: "/pay", component: PageSchedule},
    {
        path: "/establish",
        component: PageEstablish,
        children: [
            {path: "/establish/user", component: ScreenUser},
            {path: "/establish/user-group", component: ScreenUserGroup},
            {path: "/establish/authority", component: ScreenAuthority},
            {path: "/establish/digital-sign", component: ScreenAuthority},
        ]
    },

]

const router = createRouter({
    history: createWebHistory(),
    routes: routers,
})

const app = createApp(App);
app.component("DxSelectBox", DxSelectBox);
app.component("DxTagBox", DxTagBox);
app.component("DxCheckBox", DxCheckBox);
app.component("DxDropDownBox", DxDropDownBox);
app.component("DxTreeView", DxTreeView);
app.component("DxDataGrid", DxDataGrid);
app.component("DxColumn", DxColumn);
app.component("DxScrolling", DxScrolling);
app.component("DxPaging", DxPaging);
app.component("BaseInput", BaseInput);
app.component("BaseButton", BaseButton);
app.component("BasePaging", BasePaging);


app.use(router).mount('#app')
